- input: "TEXT\x1CC00005561\x1CX0\x1C\x1CF3XA\x1CThe Committee is in receipt of your
    letter dated March 18, 2010 and offers the following response:    1.The refund
    reported on Line 15 for Cox Communication was a refund of the payment made on
    March 12, 2009.  The refund reported on Line 15 from the Internal Revenue Service
    was a refund of the payment made on March 19, 2009. Please note that even though
    the original payment was reported on Schedule H4, the Committee did NOT transfer
    in non federal funds for the non federal share.  Therefore the refund, which was
    deposited into the federal account, had no obligation to transfer any funds to
    the non federal account.    2. The payment to Payroll Matters reflects the corresponding
    itemizations.  3. The payment to Michael Maurino reflects the corresponding itemizations.
    \ 4. The purpose code Consulting/Political has been clarified with a more detailed
    purpose description.  These payments were not made in connection with a federally
    identified candidate.  5. The payments to Michael Maurino were not for fundraising
    events but rather Committee meetings and seminars, which are administrative expenses.
    \ The purpose code has been changed to reflect this.    ....  Transfers received
    from the DNC, DCCC, DSCC and candidate committees, not including ASDC/Dollars
    for Democrats and DNC Victory Fund, were not for joint fundraising.  None of the
    transfer in money received from the DNC or DCCC was used in the payments made
    for exempt activities.  None of the expenses listed on Line 21b were public communications
    or FEA activities.  None of the expenditures listed on Line 30b were expressed
    advocacy.  The payments listed on H4, including all consulting fees, were administrative/committee
    fundraising expenses and not FEA nor in connection with a federal election.  Payroll
    and all related expenses reported on Schedule H4 were for staff that did not spend
    more than 25% of their time on FEA or in connection with a federal election.    \n"
